INSERT INTO `news` (`id`, `title`, `content`, `published_at`, `author_id`, `created_at`, `updated_at`) VALUES
(1, 'Что нового?', '<p>Залито обновление системы. Вот что изменилось или улучшилось:</p><ul><li>Переделаны и исправлены настройки стратификации показателей температуры и кислорода в бассейнах. Теперь они работают корректно и удобно.&nbsp;</li><li>Добавлена система работа с приборами учета и показателями. Сначала нужно добавить в систему приборы учета: шестеренка - приборы учета. Затем можно вносить показания через Главное меню - Приборы. ВНИМАНИЕ! Вносятся полные значения показаний, а не разница. Система в дальнейшем сама все посчитает.&nbsp;</li><li>В календарь добавлена возможность отмечать \"Голодные дни\", когда не кормим рыбу.</li><li>Переработана главная страница. Через кнопку редактировать можно менять блоки местами и добавлять новые \"виджеты\".</li><li>Много мелких улучшений.&nbsp;&nbsp;</li></ul><p><br></p>', '2025-11-10 00:27:00', 3, '2025-11-10 00:29:33', '2025-11-10 00:36:35'),
(2, 'Новости системы', '<p>С очередным обновлением добавлено:&nbsp;</p><ul><li>Автоматический расчет количества вносимого корма<b> за одно кормление</b>. В управлении сессиями указывается сколько раз в день происходит закорм.</li><li>Переделано меню. Вся вносимая рыбоводами информация: замеры, падеж и тд. теперь <b>во вкладке \"Внести\"</b>.&nbsp;</li><li>Задания смены. Простой чеклист, который гибко настраивается. Будут дорабатываться с учетом кормления.</li><li>Много мелких улучшений и исправлений.&nbsp;</li></ul>', '2025-11-16 00:25:00', 3, '2025-11-16 00:28:44', '2025-11-16 00:30:06');
